import React from "react";

import "./App.css";
import Header from "./Header";

const App = () => {
    return (

      <div className="App">
        <Header />
        <ul>
          <li>css</li>
          <li>react</li>
          <li>js</li>
        </ul>
      </div>
    );
};

export default App;
